import logo from './logo.svg';
import React, {useState} from 'react'; 
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Layout from './Layout';
import CmpCategory from './page/admin/CmpCategory';
import CmpLogin from './page/CmpLogin';
import CmpRegistration from './page/CmpRegistration';
import CmpCreateJob from './page/CmpCreateJob';
import UserDashboard from './page/UserDashboard';
import Member from './page/Member';
import MemberView from './page/MemberView';
import MedicalBill from './page/MedicalBillView';
import MedicalBillView from './page/MedicalBillView';
import ShowBill from './page/ShowBill';
import Usertable from './page/Usertable';

function App()
 {
  return (
    <div class="app">
      <BrowserRouter>
      <Routes>
      <Route path='/lay' element={<Layout/>}/>
      <Route index element={<CmpLogin/>}/ >
        <Route path='/cmpcat' element={<CmpCategory/>}/ > 
        <Route path='/cmpreg' element={<CmpRegistration/>}/ >
        <Route path='/cmpc' element={<CmpCreateJob/>}/ >
        <Route path='/userdashboard' element={<UserDashboard/>}/ >
        <Route path='/member' element={<Member/>}/ >
        <Route path='/memberview' element={<MemberView/>}/ >
        <Route path='/medicalbillview' element={<MedicalBillView/>}/ >
        <Route path='/showbill' element={<ShowBill/>}/ >
        <Route path='/usertable' element={<Usertable/>}/ >
        <Route path='/newmedicalbill' element={<Ne/>}/ >


      </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
